import React, { Component } from 'react'
import Home from './Home'
export class Render extends Component {
    constructor() {
        super();

        this.state  = {
            products: []
        }
    }
    componentDidMount() {
        fetch('http://localhost/lister/Home')
            .then(x  =>  x.json())
            .then(x  => this.setState({ products:  x}));
    }
    render() {
        return (
            <div>
                <Home />
            </div>
        )
    }
}

export default Render
